import React, { useState, useEffect } from 'react';
import axios from 'axios';
import './App.css';

const API_BASE_URL = 'http://localhost:5001/api/tasks'; // Changed from 5000 to 5001

function App() {
  const [tasks, setTasks] = useState([]);
  const [description, setDescription] = useState('');
  const [loading, setLoading] = useState(false);

  // Fetch all tasks
  const fetchTasks = async () => {
    try {
      setLoading(true);
      const response = await axios.get(API_BASE_URL);
      setTasks(response.data);
    } catch (error) {
      console.error('Error fetching tasks:', error);
    } finally {
      setLoading(false);
    }
  };

  // Add a new task
  const addTask = async (e) => {
    e.preventDefault();
    if (!description.trim()) return;

    try {
      const response = await axios.post(API_BASE_URL, { description });
      setTasks([...tasks, response.data]);
      setDescription('');
    } catch (error) {
      console.error('Error adding task:', error);
    }
  };

  // Complete the next task
  const completeNextTask = async () => {
    try {
      await axios.post(`${API_BASE_URL}/complete-next`);
      fetchTasks(); // Refresh the task list
    } catch (error) {
      console.error('Error completing task:', error);
    }
  };

  // Delete a task
  const deleteTask = async (id) => {
    try {
      await axios.delete(`${API_BASE_URL}/${id}`);
      setTasks(tasks.filter(task => task._id !== id));
    } catch (error) {
      console.error('Error deleting task:', error);
    }
  };

  // Get priority label
  const getPriorityLabel = (priority) => {
    switch (priority) {
      case 1: return 'High';
      case 2: return 'Medium';
      case 3: return 'Low';
      default: return 'Unknown';
    }
  };

  // Get priority class
  const getPriorityClass = (priority) => {
    switch (priority) {
      case 1: return 'high-priority';
      case 2: return 'medium-priority';
      case 3: return 'low-priority';
      default: return '';
    }
  };

  useEffect(() => {
    fetchTasks();
  }, []);

  return (
    <div className="App">
      <header className="App-header">
        <h1>AI-Based Priority To-Do List</h1>
        <p>Tasks are automatically prioritized using AI or keyword analysis</p>
      </header>

      <main>
        <form onSubmit={addTask} className="task-form">
          <input
            type="text"
            value={description}
            onChange={(e) => setDescription(e.target.value)}
            placeholder="Enter a task (e.g., 'Finish report tomorrow')"
            className="task-input"
          />
          <button type="submit" className="add-button">Add Task</button>
        </form>

        <div className="controls">
          <button onClick={completeNextTask} className="complete-button">
            Complete Next Task
          </button>
        </div>

        {loading ? (
          <p>Loading tasks...</p>
        ) : (
          <div className="tasks-container">
            <h2>Your Tasks ({tasks.length})</h2>
            {tasks.length === 0 ? (
              <p>No tasks yet. Add your first task above!</p>
            ) : (
              <ul className="tasks-list">
                {tasks.map((task) => (
                  <li key={task._id} className={`task-item ${getPriorityClass(task.priority)} ${task.completed ? 'completed' : ''}`}>
                    <div className="task-content">
                      <span className="task-description">{task.description}</span>
                      <span className={`priority-badge ${getPriorityClass(task.priority)}`}>
                        {getPriorityLabel(task.priority)} Priority
                      </span>
                    </div>
                    <div className="task-actions">
                      <button 
                        onClick={() => deleteTask(task._id)}
                        className="delete-button"
                      >
                        Delete
                      </button>
                    </div>
                  </li>
                ))}
              </ul>
            )}
          </div>
        )}
      </main>
    </div>
  );
}

export default App;
